import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import IngredientesScreen from './screens/IngredientesScreen';
import ABMIngredientesScreen from './screens/IngredientesScreen';

const Stack = createNativeStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Ingredientes">
        <Stack.Screen name="Ingredientes" component={IngredientesScreen} />
        <Stack.Screen name="ABM Ingredientes" component={ABMIngredientesScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
